import React from 'react'
import { connect } from 'react-redux'
import DropDown from './dropDown'
import user from '../../static/icons/user.png'
// import Notification from '../dashboard/Notification'

const SignedInLinks = (props) => {

  const { profile } = props
  const userImage = profile && profile.pictureUrl ? profile.pictureUrl : user
  const id = props.auth.uid
  const { notifications } = props

  const handleKeyUp = () => {

  }

  const hancleClick = () => {
    alert("works!")
  }

  return(
    <div className="nav_logo_cont_wrap">
      <div>
          <div className="search">
            <span
              className="searchbar">
              <i className="material-icons">search</i>
            </span>
            <span
              className="editable"
              contentEditable="true"
              data-placeholder="User Name or Category"
              onKeyUp={handleKeyUp}>
              </span>
          </div>
      </div>
      <ul className="right nav-links">
        <li className="drop_down-btn">
          <img
            src={userImage}
            className="circle_img"
            alt="dp"
            height="40px"
            width="40px" />
          <DropDown
            id={id}
            notifications={notifications}
            onClick={hancleClick}/>
        </li>
      </ul>
    </div>
  )
}

const mapStateToProps = (state) => {
  // console.log(state)
  return {
    profile: state.firebase.profile,
    auth: state.firebase.auth,
    notifications: state.firestore.ordered.notifications
  }
}

export default connect(mapStateToProps)(SignedInLinks)
